          <img className='burger_header' src="/images/burger_header.svg" alt="" />
          <div className="header_content">
            <h1>Только самые <h1 className='red'>сочные бургеры!</h1></h1>
            <h2>Бесплатная доставка от 599₽</h2>
          </div>
        </div>
      </header>
    )
  }

  export default Header;
